// In App.js in a new project

import * as React from 'react';
import { View, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import Home from './src/pages/Home';
import Question1 from './src/pages/Q1';
import Question2 from './src/pages/Q1';
import Question3 from './src/pages/Q1';

const Stack = createNativeStackNavigator();

const quiz = require('./quiz.json')

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
      <Stack.Screen name="Q1" component={Question1} initialParams={quiz[0]} />
      <Stack.Screen name="Q2" component={Question2} initialParams={quiz[1]}/>
      <Stack.Screen name="Q3" component={Question3} initialParams={quiz[2]}/>
      <Stack.Screen name="Home" component={Home} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
